import React, { useState, useContext } from "react";
import { Link, useNavigate } from "react-router-dom";
import { AuthContext } from "../../context/AuthContext";
import "./Navbar.css"; // Import the custom CSS file

const Navbar = () => {
  const { user, logout } = useContext(AuthContext);
  const navigate = useNavigate();
  const [open, setOpen] = useState(false);

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="navbar-content">
          <div className="navbar-brand">
            <Link to="/">Gram Panchayat</Link>
          </div>

          {/* Desktop Menu */}
          <div className="nav-desktop-menu">
            <Link className="nav-link" to="/">Home</Link>
            <Link className="nav-link" to="/about">About</Link>
            <Link className="nav-link" to="/services">Services</Link>
            <Link className="nav-link" to="/schemes">Schemes</Link>
            <Link className="nav-link" to="/notices">Notices</Link>
            <Link className="nav-link" to="/development">Development</Link>
            <Link className="nav-link" to="/gallery">Gallery</Link>
            <Link className="nav-link" to="/contact">Contact</Link>

            {user ? (
              <>
                <Link className="nav-link" to="/apply-service">Apply Service</Link>
                <Link className="nav-link" to="/application-status">My Applications</Link>
                <button
                  onClick={handleLogout}
                  className="nav-button nav-button-logout"
                >
                  Logout
                </button>
              </>
            ) : (
              <>
                <Link className="nav-link" to="/login">Login</Link>
                <Link className="nav-link" to="/register">Register</Link>
              </>
            )}
          </div>

          {/* Mobile Menu Button */}
          <div className="nav-mobile-button">
            <button onClick={() => setOpen(!open)} className="nav-toggle">
              <svg
                className="nav-icon"
                fill="none"
                stroke="currentColor"
                viewBox="0 0 24 24"
              >
                {open ? (
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M6 18L18 6M6 6l12 12" />
                ) : (
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16M4 18h16" />
                )}
              </svg>
            </button>
          </div>
        </div>
      </div>

      {/* Mobile Menu */}
      {open && (
        <div className="nav-mobile-menu">
          <Link className="mobile-nav-link" to="/">Home</Link>
          <Link className="mobile-nav-link" to="/about">About</Link>
          <Link className="mobile-nav-link" to="/services">Services</Link>
          <Link className="mobile-nav-link" to="/schemes">Schemes</Link>
          <Link className="mobile-nav-link" to="/notices">Notices</Link>
          <Link className="mobile-nav-link" to="/development">Development</Link>
          <Link className="mobile-nav-link" to="/gallery">Gallery</Link>
          <Link className="mobile-nav-link" to="/contact">Contact</Link>

          {user ? (
            <>
              <Link className="mobile-nav-link" to="/apply-service">Apply Service</Link>
              <Link className="mobile-nav-link" to="/application-status">My Applications</Link>
              <button
                onClick={handleLogout}
                className="nav-button mobile-nav-button-logout"
              >
                Logout
              </button>
            </>
          ) : (
            <>
              <Link className="mobile-nav-link" to="/login">Login</Link>
              <Link className="mobile-nav-link" to="/register">Register</Link>
            </>
          )}
        </div>
      )}
    </nav>
  );
};

export default Navbar;
